import React, { useState, Fragment } from "react";
import { Button, Divider, Modal } from "antd";
import { deleteUser } from "../../../../../services/userServices";

const deleteItem = async item => {
  try {
    await deleteUser(item);
  } catch (error) {}
};
const edit = async items => {
  console.log(items);
};

const Edit = () => {
  const [visible, setVisible] = useState();

  const showModal = () => {
    setVisible(true);
  };

  return <Modal></Modal>;

  const column = [
    {
      title: "Employee Info",
      children: [
        {
          title: " First name",
          dataIndex: "first_name",
          fixed: "left",
          sorter: (a, b) => a.first_name.length - b.first_name.length,
          sortDirections: ["descend", "ascend"]
        },
        {
          title: "Last Name",
          dataIndex: "last_name",
          fixed: "left",
          onFilter: (value, record) => record.last_name.indexOf(value) === 0,
          sorter: (a, b) => a.last_name.length - b.last_name.length,
          sortDirections: ["descend", "ascend"]
        },
        {
          title: "Gender",
          dataIndex: "gender",
          filters: [
            {
              text: "Female",
              value: "female"
            },
            {
              text: "Male",
              value: "male"
            }
          ],
          filterMultiple: false,
          onFilter: (value, record) => record.gender.indexOf(value) === 0
        },
        {
          title: "Age",
          dataIndex: "age",
          sorter: (a, b) => a.age - b.age,
          sortDirections: ["descend", "ascend"]
        },
        {
          title: "Address",
          dataIndex: "address",

          filters: [
            {
              text: "Huangpu",
              value: "Huangpu"
            },
            {
              text: "Changning",
              value: "Changning"
            },
            {
              text: "Jing'an",
              value: "Jing'an"
            },
            {
              text: "Putuo",
              value: "Putuo"
            },
            {
              text: "Hongkou",
              value: "Hongkou"
            },
            {
              text: "Yangpu",
              value: "Yangpu"
            },
            {
              text: "Minhang",
              value: "Minhang"
            },
            {
              text: "Baoshan",
              value: "Baoshan"
            },
            {
              text: "Jiading",
              value: "Jiading"
            },
            ,
            {
              text: "Pudong",
              value: "Pudong"
            },
            ,
            {
              text: "Jinshan",
              value: "Jinshan"
            },
            ,
            {
              text: "Songjiang",
              value: "Songjiang"
            },
            ,
            {
              text: "Qingpu",
              value: "Qingpu"
            },
            ,
            {
              text: "Fengxian",
              value: "Fengxian"
            },
            ,
            {
              text: "Chongming",
              value: "Chongming"
            }
          ],

          onFilter: (value, record) => record.address.indexOf(value) === 0,
          sorter: (a, b) => a.address.length - b.address.length,
          sortDirections: ["descend", "ascend"]
        },
        {
          title: "Phone",
          dataIndex: "phone_number",

          sorter: (a, b) => a.phone_number.length - b.phone_number.length,
          sortDirections: ["descend", "ascend"]
        },
        {
          title: "Position",
          dataIndex: "work_position",
          filters: [
            {
              text: "Chef",
              value: "Chef"
            },
            {
              text: "Waiter",
              value: "Waiter"
            },
            {
              text: "Manager",
              value: "Manager"
            },
            {
              text: "Cleaner",
              value: "Cleaner"
            }
          ],
          onFilter: (value, record) => record.work_position.indexOf(value) === 0
        },
        {
          title: "Salary",
          dataIndex: "salary",

          sorter: (a, b) => a.salary.length - b.salary.length,
          sortDirections: ["descend", "ascend"]
        },
        {
          title: "Email",
          dataIndex: "email",

          sorter: (a, b) => a.email.length - b.email.length,
          sortDirections: ["descend", "ascend"]
        },
        {
          title: "Date",
          dataIndex: "date",
          sorter: (a, b) => a.date.length - b.date.length,
          sortDirections: ["descend", "ascend"]
        }
      ]
    },
    {
      title: "Action",
      fixed: "right",
      render: record => (
        <Fragment>
          <Button onClick={() => deleteItem(record.id)} type="danger">
            delete
          </Button>
          <Divider />

          <Button type="primary" onClick={showModal}>
            edit
          </Button>
        </Fragment>
      )
    }
  ];
};
export { Edit };
